import React, { useState, useEffect } from "react"
import axios from "axios";
/* components and style */
import MainSecondHeder from "../components/MainSecoundHeder";
import Button from "../components/Button";
export default function ListUser() {
    const [listUser, setUser] = useState([]);
    const [role, setRole] = useState("admin");
    const [views, setViews] = useState("");
    const [oneUser, setOneUser] = useState({
        personalData: [],
        address: []
    });

    const userList = () => {
        axios.post("http://127.0.0.1:8080/user/all")
            .then((res) => {
                setUser(res.data)
            })
    };

    const userOne = (_id) => {
        axios.get("http://127.0.0.1:8080/user/" + _id)
            .then((res) => {
                setOneUser(res.data)
            })
    }

    const tableName = () => {
        if (role === "employee") {
            return "Lista Pracowników"
        } else if (role === "client") {
            return "Lista Klijetów"
        } else {
            return "Administratorzy strony"
        }
    }
    useEffect(() => {
        userList()
    }, [])

    if (views === "oneUser") {

        if (role === "client") {
            return (
                <div>
                    <MainSecondHeder>{oneUser.personalData.firstName}</MainSecondHeder>
                    <table>
                        <thead>
                            <tr>
                                <td>
                                    Dane Personalne
                                </td>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>
                                    Imię
                                </td>
                                <td>{oneUser.personalData.firstName}</td>
                            </tr>
                            <tr>
                                <td>Nazwisko</td>
                                <td>{oneUser.personalData.lastName}</td>
                            </tr>
                            <tr>
                                <td>PESEL</td>
                                <td>{oneUser.personalData.numberId}</td>
                            </tr>
                            <tr>
                                <td>
                                    Dane Kontaktowe
                                </td>
                            </tr>
                            <tr>
                                <td>Email</td>
                                <td>{oneUser.email}</td>
                            </tr>
                            <tr>
                                <td>Numer telefonu</td>
                                <td>{oneUser.phoneNumber}</td>
                            </tr>
                            <tr>
                                <td>Adres</td>
                            </tr>
                            <tr>
                                <td>Miasto</td>
                                <td>{oneUser.address.city}</td>
                            </tr>
                            <tr>
                                <td>Ulica</td>
                                <td>{oneUser.address.street}</td>
                            </tr>
                            <tr>
                                <td>Numer Domu</td>
                                <td>{oneUser.address.number}</td>
                            </tr>
                            <tr>
                                <td>Kod Pocztowy</td>
                                <td>{oneUser.address.zipCode}</td>
                            </tr>
                        </tbody>
                    </table>
                    <Button
                    onClick={()=>userList()}>Wróć</Button>
                </div>
            )
        } else {
            return (
                <div>
                    <MainSecondHeder>{oneUser.personalData.firstName}</MainSecondHeder>
                </div>
            )

        }

    }
    return (
        <div>
            <MainSecondHeder>Lista Użytkowników</MainSecondHeder>
            <div>
                <Button onClick={() => setRole('admin')}>Administratorzy</Button>
                <Button onClick={() => setRole('employee')}>Pracownicy</Button>
                <Button onClick={() => setRole('client')}>Klięci</Button>
            </div>
            <table>
                <thead>
                    <tr>
                        <td><p>{tableName()}</p> </td>
                    </tr>
                    <tr>
                        <td>Imię</td>
                        <td>Numer Kontaktowy</td>
                        <td>Emial</td>
                        <td>Akcje</td>
                    </tr>
                </thead>
                <tbody>
                    {listUser.map((user) => {
                        if (user.role === role) {
                            return (
                                <tr key={user._id}>
                                    <td>
                                        {user.personalData.firstName}
                                    </td>
                                    <td>{user.phoneNumber}</td>
                                    <td>{user.email}</td>
                                    <td><Button onClick={() => {
                                        userOne(user._id)
                                        setViews("oneUser")
                                    }}>Wiecej informacji</Button></td>
                                </tr>
                            );
                        }
                        return null;
                    })}
                </tbody>
            </table>

        </div>


    )
}
